import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import PuzzleImage from '../assets/img/puzzle.jpg';
import ChatBot from '../assets/img/bot.jpg';
import Yoga from '../assets/img/yoga.jpg';
import Depression from '../assets/img/depression.jpg';
import Game from './Game';

const HomeContent = ({ activeButton }) => {
    const [gameClicked, setGameClicked] = useState(false);

    const handleGameClick = () => {
        setGameClicked(true);
    };

    const handleBackClick = () => {
        setGameClicked(false);
    };

    return (
        <div id="carouselExampleControls" className="carousel slide" data-ride="carousel">
            <div className="carousel-inner">
                <div className={`carousel-item ${!gameClicked ? 'active' : ''}`}>
                    <img className="d-block w-100" src={PuzzleImage} alt="First slide" />
                    <div className="carousel-caption">
                        <h3>Game</h3>
                        <p>
                            <span onClick={handleGameClick} style={{ cursor: 'pointer' }}>Game</span>
                        </p>
                    </div>
                </div>
                <div className={`carousel-item ${gameClicked ? 'active' : ''}`}>
                    {gameClicked && (
                        <>
                            <h2 style={{ color: 'white', fontWeight: 'bold' }}>Puzzle Game</h2>
                            <Game />
                            <button onClick={handleBackClick} style={{ backgroundColor: 'white', color: '#007bff', fontSize: '30px', fontWeight: 'bold' }}>Back</button>
                        </>
                    )}
                </div>
                <div className="carousel-item">
                    <img className="d-block w-100" src={ChatBot} alt="Second slide" />
                    <div className="carousel-caption">
                        <h3>ChatBot</h3>
                        <p>
                            <Link to={'/chat'}>ChatBot</Link>
                        </p>
                    </div>
                </div>
                <div className="carousel-item">
                    <img className="d-block w-100" src={Yoga} alt="Third slide" />
                    <div className="carousel-caption">
                        <h3>Yoga</h3>
                        <p>Yoga</p>
                    </div>
                </div>
                <div className="carousel-item">
                    <img className="d-block w-100" src={Depression} alt="Fourth slide" />
                    <div className="carousel-caption">
                        <h3>Depression</h3>
                        <p>Depression</p>
                    </div>
                </div>
            </div>
            <a className="carousel-control-prev" href="#carouselExampleControls" role="button" data-slide="prev">
                <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                <span className="sr-only">Previous</span>
            </a>
            <a className="carousel-control-next" href="#carouselExampleControls" role="button" data-slide="next">
                <span className="carousel-control-next-icon" aria-hidden="true"></span>
                <span className="sr-only">Next</span>
            </a>
        </div>
    );
};

export default HomeContent;
